const testFileTree = {
  name: "root",
  assets: {
    name: "assets",
    images: {
      name: "images",
      "logo.png": { name: "logo.png" },
      "avatar.jpg": { name: "avatar.jpg" },
    },
  },
  "index.js": { name: "index.js" },
};

export default testFileTree;
